// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";

contract NinjaTeam {
    using SafeERC20 for IERC20;
    using SafeMath for uint256;
    address payable public Donatello; // 0.3x
    address payable public Raphael;  // 0.3x
    address payable public Michelangelo; //0.3x
    address payable public Leonardo; //0.1x
    IERC20 public NINJA;

    constructor(
            address payable _Donatello,
            address payable _Raphael,
            address payable _Michelangelo,
            address payable _Leonardo,
            IERC20 _ninja
    ) public {
            Donatello = _Donatello;
            Raphael = _Raphael;
            Michelangelo = _Michelangelo;
            Leonardo = _Leonardo;
            NINJA = _ninja;
    }

      modifier onlyTeam() {
        require(
            Donatello == msg.sender || Raphael == msg.sender || Michelangelo == msg.sender || Leonardo  == msg.sender,
            "No Permission"
        );
        _;
    }
    function updateDonatelloAdd(address payable _Donatello) public onlyTeam {
        Donatello = _Donatello;
    }
    function updateRaphaelAdd(address payable _Raphael) public onlyTeam {
        Raphael = _Raphael;
    }
    function updateMichelangeloAdd(address payable _Michelangelo) public onlyTeam {
        Michelangelo = _Michelangelo;
    }
    function updateLeonardoAdd(address payable _Leonardo) public onlyTeam {
        Leonardo = _Leonardo;
    }

    function withdrawBNB() public onlyTeam {
        uint256 BnbBal = address(this).balance;
        uint256 x3 = BnbBal.mul(30).div(100);
        uint256 x1 = BnbBal.mul(10).div(100);
        Donatello.transfer(x3);
        Raphael.transfer(x3);
        Michelangelo.transfer(x3);
        Leonardo.transfer(x1);
    }

    function withdrawNINJA() public onlyTeam {
        uint256 balance = NINJA.balanceOf(address(this));
        uint256 x333 = balance.mul(333).div(100);
        uint256 x34 = balance.sub(x333.mul(2));
        NINJA.safeTransfer(Donatello, x333);
        NINJA.safeTransfer(Raphael, x333);
        NINJA.safeTransfer(Michelangelo, x34);
    }

    function updateNinjaAdd(address newNinja) public onlyTeam {
        // incase of change Ninja
        require(newNinja != address(0), "Ninja Token address invalid");
        NINJA = IERC20(newNinja);
    }

}
